$(function () {
  var $slider = $(".banner_cards_slide");
  $slider.on("beforeChange", function (event, slick, currentSlide, nextSlide) {
    $slider.find(".slick-slide").each(function (index, el) {
      var $this = $(el),
        slickindex = $this.attr("data-slick-index");
      if (nextSlide == slick.slideCount - 1 && currentSlide == 0) {
        // 現在のスライドが最初のスライドでそこから最後のスライドに戻る場合
        if (slickindex == "-1") {
          // 最後のスライドに対してクラスを付与
          $this.addClass("is-active-next");
        } else {
          // それ以外は削除
          $this.removeClass("is-active-next");
        }
      } else if (nextSlide == 0) {
        // 次のスライドが最初のスライドの場合
        if (slickindex == slick.slideCount) {
          // 最初のスライドに対してクラスを付与
          $this.addClass("is-active-next");
        } else {
          // それ以外は削除
          $this.removeClass("is-active-next");
        }
      } else {
        // それ以外は削除
        $this.removeClass("is-active-next");
      }
    });
  });
  $(".banner_cards_slide").not(".slick-initialized").slick({
    autoplay: true,
    autoplaySpeed: 3000,
    speed: 1000,
    infinite: true,
    arrows: true,
    fade: false,
    dots: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    centerMode: true,
    centerPadding: "15%",
    responsive: [{
      breakpoint: 1025,
      settings: {
        slidesToShow: 3
      }
    }, {
      breakpoint: 768,
      settings: {
        slidesToShow: 1,
        centerMode: true,
        centerPadding: "60px"
      }
    }]
  });
});
